                 <form action="">
                     <input type="text" className="form-control" placeholder="Title" />
                     <textarea name="" className="form-control" id="" cols="10" rows="5" placeholder="Write your note here..."></textarea>
                 </form>
             </div>
         </div>
        </div>
    </>
};

